import os
import platform
import base64 as bb


# background_png = """"""


# background_centered_png = """"""


background_centered_png_new = """"""


img_textBox0_png = """"""


img0_png = """"""


img1_png = """"""


img2_png = """"""


# Multi OS Support
if platform.system().lower().startswith('win'):
    UNIX = False
    CLEAR = "cls"
    BSP = "\\"
else:
    UNIX = True
    CLEAR = "clear"
    BSP = "/"


def FOR_DEVS():
    with open("background_new_new.png", "rb") as fileb1:
        filcont = fileb1.read()

    with open("image.txt", "w") as fcreate:
        encoded = bb.b64encode(filcont)
        fcreate.write(encoded.decode())


def DECODED_IMAGE(image):
    data = bb.b64decode(image)
    return data


def CREATE_ALL_IMAGES():
    os.system("mkdir assets")

    with open(f"assets{BSP}background.png", "wb") as fileb1:
        fileb1.write(DECODED_IMAGE(background_centered_png_new))

    with open(f"assets{BSP}img_textBox0.png", "wb") as fileb2:
        fileb2.write(DECODED_IMAGE(img_textBox0_png))

    with open(f"assets{BSP}img0.png", "wb") as fileb3:
        fileb3.write(DECODED_IMAGE(img0_png))

    with open(f"assets{BSP}img1.png", "wb") as fileb4:
        fileb4.write(DECODED_IMAGE(img1_png))

    with open(f"assets{BSP}img2.png", "wb") as fileb5:
        fileb5.write(DECODED_IMAGE(img2_png))


def DELETE_ALL():
    try:
        os.remove("assets")
    except:
        if UNIX:
            os.system("rm -rf assets")
        else:
            os.system("rmdir /q /s assets")
